import React from 'react';

function ProductDetail({ product, onEdit }) {
  if (!product) {
    return <div>No product found for this Trace ID.</div>;
  }

  return (
    <div>
      <h2>Product Details</h2>
      <p><strong>Trace ID:</strong> {product.id}</p>
      <p><strong>Seed Variety:</strong> {product.seedVariety}</p>
      <p><strong>Date of Sow:</strong> {product.dateSow}</p>
      <p><strong>Location Grown:</strong> {product.locationGrown}</p>
      <p><strong>Date Harvested:</strong> {product.dateHarvested}</p>
      <p><strong>THC%:</strong> {product.thc}</p>
      <button onClick={onEdit} style={{ marginTop: 16 }}>Edit Product</button>
    </div>
  );
}

export default ProductDetail;
